import MyImage from '../components/destaque';
import ContumazHead from '../components/contumaz_head';
import ContumazMenu from '../components/contumaz_menu';
import ContumazHeader from '../components/contumaz_header';
import ContumazFooter from '../components/contumaz_footer';

function Contumaz() {
    return (
      <div>
        <ContumazHead/>        
        <ContumazMenu/>
        <ContumazHeader/>
        <ContumazFooter/>       

        <div>
          <div>Destaques</div>
          <div>
            <MyImage/>
            <h3>Degradação ambiental e esclusão social</h3>
            <p>Os impactos socioeconômicos da destruição da natureza</p>
          </div>
          <div>
            <MyImage/>
            <h3>Degradação ambiental e esclusãoa social</h3>
            <p>Os impactos socioeconômicos da destruição da natureza</p>
          </div>
          <div>
            <MyImage/>
            <h3>Degradação ambiental e esclusão social</h3>
            <p>Os impactos socioeconômicos da destruição da natureza</p>
          </div>
        </div>      
      </div>
    );
}
export default Contumaz;
